import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div class = "Text">
        <h2 class = "name">IMPULSIVE KOALA</h2>
        <h1 class = "heading">UX Researcher passionate about <i>solving problems</i>by understanding interfaces and<br/>examining how <i>people interact with them</i>.</h1>
      </div>
    </div>
  );
}

export default App;
